@7:00 about recording audio without the other person's consent.  That's only an issue for states that are known as "Two-Party Consent States" like for example Florida, but for states that are known as "One Party Consent States" like for example New York then it is not an issue.  As long as at least one party of a conversation is ok with the recording than its a legal court admissible recording.  However, there could be some "gray area" where if you capture an audio conversation where you are not the party of a conversation that is happening within a group of person but for that, you would need to speak with a lawyer just to clear things up and make sure if in that case, it's legal because you own the vehicle and you gave consent to that recording happening.  

* The one and two-party content laws are more geared to phone conversations, but I don't see how it cannot be extended into a video conversation especially if you are a party to that conversation 

* This is not legal advice, I provide this info as-is.  Do your own research to be 100% sure if in your own particular case your recordings can be defended with the "One-Party Consent" Doctrine.

