@Xabc Yabc The reason it's not a problem is because you don't drive a full battery or full tank of gas in one day. Most people drive maybe 20-60 miles per day. So if you charge your car in your garage overnight (6 hours) you get 180 miles every night.
Or if you live in an apartment and don't have a garage, then once every week or two weeks you have to charge your car at a supercharger station for 45 minutes. 
So really, it's not that bad. If you have a garage, it's even better than going to a gas station.

@Sean P Once upon a time, yes. Tesla fixed that a while ago, but a lot of the old FUD persists.

Only real maintenance is basic suspension and tires that any shop can do. Then ever 50k miles you need to flush the coolant, but I've known a few people who do it themselves so I assume shops could too. Only thing you need to go to a Tesla dealer for is when you have problems with the motors or batteries (which is very rare in the newer models) and then you can schedule it all from the Tesla app.

As a gear head, the Model 3 ruined all other cars for me. I still appreciate high end ICE cars, but I hope to never go back to driving one everyday.

@Goeycow That's a really interesting point you touch on. A lot of the Tesla enthusiasts are really more tech enthusiasts, rather than car enthusiasts. I used to be obsessed with Tesla's myself, but then switched to being much more of a car enthusiast. I still find them to be interesting vehicles, but they've taken much lower on my priority list than they once were. There's a lot of other cars out there that are more enthusiast oriented than a Tesla.

It was a weird and interesting experience meeting another Tesla tech enthusiast in real life (this was after I made the transition from Tesla enthusiast to car enthusiast). He was happy to talk about the ins and outs of Tesla vehicles to no end, but as soon as I mentioned another car I could tell I had lost him in an instant.

Not that I'm trying to say there's anything wrong with Tesla tech enthusiasts, but it's amazing to see how drastically different they are from the rest of the car community.
